INSERT INTO `automacao` (`id`, `date`, `assunto`, `filtros`, `corpo`, `status`, `log`, `aberturas`) VALUES
(2, '2017-01-04 00:00:00', 'AJUDA MUTUA COM VELOCIDADE DE VERDADE', 'a:1:{i:0;s:7:\"todos-1\";}', '<p>Conheça a Now x a rede de ajuda mútua mais veloz do Brasil.<br></p><p>Mil vagas, começamos ontem e hoje mais de 200 pessoas já receberam o primeiro ciclo de 280,00 e já estão prontas para pegar 3320,00.</p><p>Quer participar faça já seu cadastro e entre na fila.</p><p>ESSA VAI SER UMA EXPLOSÃO DE CADASTROS</p><p>Um método simples e rápido de se capitalizar para começar 2017.<br></p><br><p>A&nbsp;<span style=\"font-weight: 700;\">NOW X&nbsp;</span>foi desenvolvida com foco em:&nbsp;</p><p>✅ Fechar o grupo,&nbsp;</p><p>✅ Todos receberem</p><p>✅ Trazer renda contínua e estável.</p><br><p>Veja como o método foi aperfeiçoado.</p><br><p>✅ Pré cadastro</p><p>✅ Grupo mensal fechado</p><p>✅ Derramamentos garantidos.</p><p>✅ Link Único UNIVERSAL.</p><p>✅ Reentradas mensais</p><p>✅ Cadastro Reserva</p><p>✅ Supers Ciclos com apenas 2 níveis de profundidade (ganhos estimados em 72h)</p><p>✅ Doações automáticas para o upline (aqui o furão não tem vez)</p><p>✅ Três supers ciclos de evolução nos ganhos.</p><p>Olha que legal!</p><p>Faça seu cadastro http://nowx.club</p><p><span style=\"font-weight: 700;\">Ciclo 1</span></p><p>Doe 40,00</p><p>Recebe 7x 40,00=280,00</p><p>Reentrada 2x40,00=80,00</p><p>Obs.: 280,00-40,00-80,00-200,00=0,00</p><br><p><span style=\"font-weight: 700;\">Ciclo 2</span></p><p>Doe 200,00</p><p>Recebe 3x200,00=600,00</p><p>Reentrada 2x40,00=80,00</p><p>Obs.:</p><p>600,00-80,00-500,00=20,00</p><br><p><span style=\"font-weight: 700;\">Ciclo 3</span></p><p>Doe 500,00</p><p>Recebe 7x500,00=3.500,00</p><p>Reentrada 3x40,00=120,00</p><p>Entrada 40,00</p><p>Obs.:</p><p>3.500,00-120,00-40,00+20,00=3.360,00</p><p>&nbsp;Faça seu cadastro http://nowx.club</p><p><span style=\"font-weight: 700;\">Vamos pra cima e avante!</span></p>', 0, NULL, 0);
